define([],function(){var e={};return e.dialog='<div style="display: none; position: fixed; z-index: 10000; left: 0px; top: 0px; right: 0px; bottom: 0px;">\r\n    <div style="position: fixed; left: 0px; top: 0px; right: 0px; bottom: 0px; background-color: #000; opacity: 0.8;">\r\n    </div>\r\n    <div id="container" style="position: fixed; left: 0px; top: 0px; right: 0px; bottom: 0px;" v-on:mousedown="dialogContainerClick($event)">\r\n    </div>\r\n</div>',e.login='<div>\r\n    <div style="width: 100%;\r\n    height: 100%;\r\n    position: absolute;\r\n    background-image: url(img/background.png);\r\n    background-position: center bottom;\r\n    bottom: 85px;"></div>\r\n\r\n    <div style="width: 100%;\r\n    height: 100%;\r\n    position: absolute;\r\n    background-image: url(img/login-figures@2x.png);\r\n    background-position: left bottom;\r\n    background-size: 45%;\r\n    background-repeat: no-repeat;\r\n    margin: -33px;"></div>\r\n\r\n    <div style="position: absolute; display: flex; flex-direction: column; margin: 5% 5%; text-align: center; " v-if="passwordLogin || tokenLogin">\r\n        <div style="display: inline-block; text-align: right;">\r\n            <img class="mb-sm" src="img/logo.png" srcset="img/logo@2x.png 2x, img/logo@3x.png 3x">\r\n            <template v-if="!comsigndocid">\r\n                <div class="mb-sm label" style="color: white; font-size: large">כניסה למערכת</div>\r\n                <div v-if="passwordLogin">\r\n                    <div>\r\n                        <input style="width:30vw; font-size: large" type="text" v-model="username" placeholder="שם משתמש" autofocus v-on:keyup="keyUp($event)">\r\n                    </div>\r\n                    <div>\r\n                        <input style="width:30vw; font-size: large" type="password" v-model="password" placeholder="סיסמה" v-on:keyup="keyUp($event)">\r\n                    </div>\r\n                </div>\r\n                <div v-if="tokenLogin">\r\n                    <div class="mb-sm" style="color: white;">\r\n                        לשם כניסה למערכת יש להזין מספר טלפון ללא מקפים\r\n                    </div>\r\n                    <input style="width:200px;" type="password" v-model="password" placeholder="מספר טלפון" autofocus v-on:keyup="keyUp($event)">\r\n                </div>\r\n            </template>\r\n            <template v-if="comsigndocid">\r\n                <div class="mb-sm label" style="color: white; font-size: large">\r\n                    תהליך החתימה הושלם, תודה והמשך גלישה מהנה.\r\n                </div>\r\n            </template>\r\n        </div>\r\n        <button id="btnLogin" v-if="!comsigndocid" class="btn mt-sm" style="width:30vw; font-size: large;" v-on:click="login()">אישור</button>\r\n        <div v-if="errorMessage != null">\r\n            <p class="alert">{{errorMessage}}</p>\r\n        </div>\r\n    </div>\r\n</div>',e.main='<div style="position: absolute; height: 100%; width: 100%;">\r\n    <view-slot v-if="!loggedIn && loggedIn != null" class="flex-fill"></view-slot>\r\n    <div v-else-if="admin" class="frame vertical-flex" v-bind:style="admin ? \'height: 100%;\' : \'padding: 2rem; height: calc(100% - 2rem);\'">\r\n        <div v-if="admin" class="admin-bar">\r\n            <div class="horizontal-flex">\r\n                <div class="tabs horizontal-flex">\r\n                    <div class="tab" v-for="tab in viewManager.tabs" v-bind:class="{active: tab.selected}">\r\n                        <div class="tab-caption" v-on:click="selectTab(tab)">\r\n                            {{tab.name}}\r\n                            \x3c!--\r\n                            <div class="close-button fa fa-close"></div>\r\n                            --\x3e\r\n                        </div>\r\n                        <div class="view-list">\r\n                            <div class="view-item" v-for="view in tab.views" v-on:click="selectView(view)" v-bind:class="{active: view.selected}">\r\n                                <span>{{view.component.caption}}</span>\r\n                                <div class="close-button fa fa-close" v-on:click="closeView($event, view)"></div>\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n                    <div class="tab" v-on:click="openNewTabDialog()">\r\n                        <div class="tab-caption">+</div>\r\n                    </div>\r\n                </div>\r\n                <div v-if="user" style="padding: 8px;" v-bind:style="{border: user.delegatedUser != null ? \'1px dashed black\' : \'\',\r\n            padding: user.delegatedUser != null ? \'5px 5px 5px 5px\' : \'inherit\'}">\r\n                    <strong v-if="user.delegatedUser">\r\n                        {{user.delegatedUser.name}}\r\n                        &larr;\r\n                        מחובר בתור\r\n                        &larr;\r\n                    </strong>\r\n                    <strong>\r\n                        {{user.name}}\r\n                    </strong>\r\n                    <strong style="color: blue; cursor: pointer" v-on:click="logout()">\r\n                        התנתק\r\n                    </strong>\r\n                </div>\r\n            </div>\r\n            <div class="title">\r\n                <div v-if="viewManager.selected && viewManager.selected.component">\r\n                    <select v-if="viewManager.selected.component.alterViews && viewManager.selected.component.alterViews.length > 0"\r\n                            v-bind:value="viewManager.selected.link"\r\n                            v-on:input="handleAlterViewChange">\r\n                        <option v-for="alterView in viewManager.selected.component.alterViews" v-bind:value="alterView.link">{{alterView.caption}}</option>\r\n                    </select>\r\n                    <span v-else>{{viewManager.selected.component.caption}}</span>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <view-slot class="flex-fill"></view-slot>\r\n    </div>\r\n    <div v-else-if="user" class="frame horizontal-flex">\r\n        <div class="menu" v-if="showMenu">\r\n            <div style="position: relative;">\r\n                <template v-for="(item, index) in menu">\r\n                    <div class="menu-item" v-bind:class="{active: item.selected}" v-on:click="open(item, index)">\r\n                        <img v-if="item.image" v-bind:src="item.selected ? item.imageActive : item.image">\r\n                        <label class="menu-label" v-bind:class="{active: item.selected}">{{item.name}}</label>\r\n                    </div>\r\n                </template>\r\n                \x3c!--\r\n                <div style="position: absolute; left: 0px; right: 0px; bottom: 0px;">\r\n                    <div class="menu-item" v-on:click="logout()">\r\n                        <label class="menu-label">התנתקות</label>\r\n                    </div>\r\n                </div>\r\n                --\x3e\r\n            </div>\r\n        </div>\r\n        <view-slot class="flex-fill"></view-slot>\r\n    </div>\r\n    <dialog-slot></dialog-slot>\r\n</div>',e});